import React from 'react';

const Home = () => {
  return (
    <div className="bg-gray-100 min-h-screen p-8">
      {/* Header Section */}
      <header className="text-center mb-10">
        <h1 className="text-4xl font-bold text-gray-800">BOSKTOM</h1>
        <p className="text-lg text-gray-600 mt-2">From Breakdown to Back on the Road.</p>
      </header>

      {/* Services Section */}
      <div className="max-w-4xl mx-auto">
        {/* First Service Block */}
        <div className="bg-white p-6 rounded-lg shadow-md mb-6">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">A little care for your great problems</h2>
          <ul className="list-none space-y-2">
            {[...Array(4)].map((_, index) => (
              <li key={index} className="flex items-center">
                <input type="checkbox" className="mr-2" />
                <span className="text-gray-700">people</span>
              </li>
            ))}
          </ul>
        </div>

        {/* Stats Section */}
        <div className="text-center my-8">
          <h2 className="text-2xl font-bold text-gray-800">25 +</h2>
          <p className="text-gray-600">TEXTED GROUP</p>
          <div className="flex justify-center space-x-4 mt-4">
            {[...Array(4)].map((_, index) => (
              <div key={index} className="bg-white p-3 rounded-lg shadow-sm">
                <span className="text-gray-700">2020/24</span>
              </div>
            ))}
          </div>
        </div>

        {/* Second Service Block */}
        <div className="bg-white p-6 rounded-lg shadow-md mb-6">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">A little care for your great problems</h2>
          <ul className="list-none space-y-2">
            {[...Array(4)].map((_, index) => (
              <li key={index} className="flex items-center">
                <input type="checkbox" className="mr-2" />
                <span className="text-gray-700">people</span>
              </li>
            ))}
          </ul>
        </div>

        {/* Third Service Block */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-gray-800 mb-4">Getting your tow truck on the road</h2>
          <ul className="list-none space-y-2">
            {[...Array(5)].map((_, index) => (
              <li key={index} className="flex items-center">
                <input type="checkbox" className="mr-2" />
                <span className="text-gray-700">people</span>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Home;
